import fetch from 'isomorphic-unfetch'
const FetchData=(props)=>(
    <div>
        <h3>获取服务端数据</h3>
        <ul>
            {
                props.productList.map(item=>(
                    <li key={item.id}>
                        {item.title}
                    </li>
                ))
            }
        </ul>
    </div>
)
// npm install --save isomorphic-unfetch
